import React from 'react';
import Or from './Or.jpeg';
import './Qr.css';

function Qr() {
  return (
    <div className='qr'>
      <img src={Or}/>
      <h2>Send ScreenShoot on  Whats app No</h2>
      <h2>7820864866</h2>
    </div>
  )
}

export default Qr
